import React from "react";
import { Bar } from 'react-chartjs-2';

const BarByFilter = ({ dicFilter, filter }) => {


  console.log(dicFilter)

  let label = [];
  if (filter === "gender") {
    label = ["Male", "Female", "Other", "Prefer not to say" ]
  }



  return (
    <div>
      <Bar
        data={{
          labels: label,
          datasets: [
            {
              label: 'General Median Salary',
              data: [10, 20, 30, 40, 50, 60],
              backgroundColor: [
                'rgba(75, 192, 192, 0.5)'
              ],
              borderColor: [
                'rgba(75, 192, 192, 1)'
              ],
              borderWidth: 0.5,
            },
          ],
        }}
        height={400}
        width={600}
        options={{
          maintainAspectRatio: false,
          scales: {
            yAxes: [
              {
                ticks: {
                  beginAtZero: true,
                }
              }
            ]
          },
          plugins: {
            legend: {
              labels: {
                font: {
                  size: 14
                }
              }
            }
          }
        }}
      />
    </div>
  )
}

export default BarByFilter;
